import React, {Component} from 'react';
import {TopHeader} from '../shared/top-header.component';

export class Recommendations extends Component {

    render() {

        const meals = [

            {meal: ' ', kcal: ' ',},
            {meal: 'Breacfast', kcal: '203 - 310',
                day1:"Combine 3/4 cup bran flakes, 1 banana, and 1 cup fat-free milk in a bowl"},
            {meal: 'Snack', kcal: '0 - 270',
                },
            {meal: 'Lunch', kcal: '303 - 440'},
            {meal: 'Snack', kcal: '0 - 270'},
            {meal: 'Dinner', kcal: '423 - 570'}

        ];
        const weekDay =[
            " ",  "Monday", "Tuesday", " Wednesday ", "Thursday", "Friday", "Saturday","Sunday"
        ] ;
        const breacfast =[

            {
                meal: 'Breacfast',  kcal: '203 - 310',
                day1: "Combine 3/4 cup bran flakes, 1 banana, and 1 cup fat-free milk in a bowl. ",
                day2: " ",
                day3: " ",
                day4: " ",
                day5: " ",
                day6: " ",
                day7: " ",
            }
        ] ;

        const lunch =[

            {
                meal: 'Breacfast',  kcal: '203 - 310',
                day1: "Combine 3/4 cup bran flakes, 1 banana, and 1 cup fat-free milk in a bowl. ",
                day2: " ",
                day3: " ",
                day4: " ",
                day5: " ",
                day6: " ",
                day7: " ",
            }
        ] ;

        const dinner =[

            {
                meal: 'Breacfast',  kcal: '203 - 310',
                day1: "Combine 3/4 cup bran flakes, 1 banana, and 1 cup fat-free milk in a bowl. ",
                day2: " ",
                day3: " ",
                day4: " ",
                day5: " ",
                day6: " ",
                day7: " ",
            }
        ] ;
        const snack =[

            {
                meal: 'Breacfast',  kcal: '203 - 310',
                day1: "Combine 3/4 cup bran flakes, 1 banana, and 1 cup fat-free milk in a bowl. ",
                day2: " ",
                day3: " ",
                day4: " ",
                day5: " ",
                day6: " ",
                day7: " ",
            }
        ] ;
        const days = weekDay.map((day, index) => (

            <th className="days" >
                <h5> {day}</h5>
            </th>

    ));





        return (

            <div>
                <TopHeader/>
                <br/>

                <div className="grayBack">
                    <h3> Weekly Diet </h3>
                    <br/>
                    <h6> 1,200-Calorie Meal Plan </h6>

                    <table className="all">
                        {days}
                      
                    </table>

                </div>

            </div>

        );
    }
}
